import React from 'react';
import styled from 'styled-components';
import { Link } from 'react-router-dom';
import Button from 'react-bootstrap/Button';

const MainSection = styled.div`
    margin: 10vh 10vw 10vh 10vw;
`;

const Main = () => {
    return (
        <MainSection>
            <Link to=''>
                <Button>
                    화보페이지로 가는 버튼
                </Button>
            </Link>
        </MainSection>
    )
};

export default Main;
